                "adtargetsummarynotesjson": "[\n  {\n    \"noteType\": \"targetSummaryMechanical\",\n    \"statement\": \"<p>Immunoglobulin G (IgG) serves as an essential component of the immune system functioning mainly as an antibody. It is found in blood and extracellular fluid making it one of the most prevalent antibodies in the human body. IgG weighs approximately 150 kDa and it is expressed by B cells as part of the humoral response to pathogens. Alternate names include gamma globulin and Ig gamma. IgG antibodies form a critical aspect of adaptive immunity by targeting specific antigens for neutralization or destruction.</p>\"\n  },\n  {\n    \"noteType\": \"targetSummaryBiological\",\n    \"statement\": \"<p>IgG participates in several immune processes by binding to antigens and forming immune complexes. It facilitates pathogen opsonization initiating phagocytosis by immune cells like macrophages and neutrophils. IgG also activates the classical complement pathway which enhances pathogen clearance. IgG exists in a monomeric form and can cross the placenta providing passive immunity to the fetus. In laboratory settings its high specificity makes it valuable in techniques like IgG ELISA for detecting antigen presence.</p>\"\n  },\n  {\n    \"noteType\": \"pathway\",\n    \"statement\": \"<p>IgG plays an integral role in the complement system and the adaptive immune response. It partners with proteins such as C1q to initiate the classical complement pathway amplifying the body's ability to detect and remove pathogens. IgG also interacts with Fc receptors on immune cells modulating immune cell activity and facilitating antigen presentation to T cells. These interactions enhance the immune system's efficiency in recognizing and responding to diverse pathogens.</p>\"\n  },\n  {\n    \"noteType\": \"disease\",\n    \"statement\": \"<p>IgG has connections to autoimmune diseases and chronic infections. Elevated levels of IgG can indicate autoimmune conditions like lupus or rheumatoid arthritis where the immune system mistakenly attacks healthy tissue. During chronic infections such as HIV variations in IgG responses can affect disease progression and treatment efficacy. In these contexts IgG interacts with proteins involved in the immune dysregulation characteristic of such diseases highlighting its significant role in both protection and pathology.</p>\"\n  }\n]",
